import { Link } from 'react-router-dom'
import "./Training.css"

function Training({id,entitate, denumire, data, speaker}){
    return(
        <>
            <h2>{denumire}</h2>
            <h3>{data}</h3>
            <h2>{speaker}</h2>
            <Link to={`/dashboard/training/${entitate}/${id}`} className='btn btn-primary btn-details'>Feedback</Link>
        </>
    )
}

export default Training
